"use strict";
exports.load = function(page) {
	var $props = page.$prototype.$properties;
	$props.embededPDF = {
		$isTitleHidden: true,
		$type: "application/pdf",
		$url: "/syracuse-ui/lib/tests/binary/binarytest.pdf"
	};
	$props.embededPNG = {
		$isTitleHidden: true,
		$type: "image/png",
		$url: "/syracuse-ui/lib/tests/binary/binarytest.png"
	};
	var root = page.layoutContent.items[0].domItem;
	page.addFieldBlock(root, "PDF", ["embededPDF"]);
	page.addFieldBlock(root, "PNG", ["embededPNG"]);
	page.applyChange({
		embededPDF: {},
		embededPNG: {}
	});
};